import React from "react";
import { Box } from "@material-ui/core";
import Hero from "../Components/Hero";
import UpComingWorks from "../Components/OurWorks/UpComings";

const gap = "100px";

let header = {
  hero: {
    heading: "UpComing Works",
    page: "Up Coming",
    image: "/assets/image.png"
  }
};
function UpComing() {
  return (
    <>
      <Hero {...header.hero} />
      <Box height={gap} />
      <UpComingWorks />

    </>
  );
}

export default UpComing;
